  @override
  Widget build(BuildContext context) {
    var size = MediaQuery.of(context).size;

    final double itemHeight = (size.height) / 3 + 200;
    final double itemWidth = size.width / 3;
    return MaterialApp(
        home: Padding(
            padding: EdgeInsets.fromLTRB(16.0, 12.0, 16.0, 8.0),
            child: GridView.count(
              crossAxisCount: 3,
              childAspectRatio: itemWidth / (itemHeight),
              children: List.generate(worklist.length, (index) {
                return GestureDetector(
                  child: worklist[index],
                  onTap: () {
                    Navigator.pushNamed(context, '/next', arguments: index);
                  },
                );
              }),
            )));
  }
}

class Worklist {
  Image image;
  String main;
  String sub;

  Worklist(String img, this.main, this.sub) {
    image = Image.network(img, width: 350, height: 250, fit: BoxFit.cover);
  }
  Container list() {
    return Container(
        child: Column(
      children: [
        image,
        Text(
          main,
          style: TextStyle(fontSize: 30),
        ),
        Text(
          sub,
          style: TextStyle(fontSize: 30),
        )
      ],
    ));
  }
}
